webpackJsonp([0x6acc17f1efe0],{1266:function(t,e){t.exports={data:{site:{siteMetadata:{title:"Psyked.co.uk",author:"James Ford"}},markdownRemark:{id:"/Users/James/Repositories/portfolio-2018/src/posts/mastering-photoshop-with-psdtutscom/index.md absPath of file >>> MarkdownRemark",html:'<p><a href="http://psdtuts.com/" title="Open link in a new window">Psdtuts</a> (Photoshop-document tutorials) hit the scene a little while ago on digg, and I\'ve had it on my RSS subscriptions ever since. Off like a dynamo with the Photoshop tutorials, I\'d certainly keep an eye on it - looks to have potential to be another Smashing Magazine. (i.e. A big hit)</p>\n<p>Now, my knowledge of Photoshop is ok, certainly on-par with those I work with, but Psdtuts? I\'m a complete novice against them. I tried to do a couple of their tutorials as a demonstration, but they didn\'t turn out so good. They make it look so easy, but I guess you need some mystical, innate knowledge if you\'re going to compete.</p>\n<p><a href="http://psdtuts.com/" title="Open link in a new window"><img src="/content/images/2007/10/11.jpg" alt="A sample improvement from photoshop"></a></p>\n<p>My favourates have got to be;</p>\n<ul>\n<li><a href="http://psdtuts.com/photo-effects-tutorials/souping-up-a-photo/" title="Open link in a new window">Souping up a photo.</a></li>\n<li><a href="http://psdtuts.com/photo-effects-tutorials/super-slick-dusky-lighting-effects-in-photoshop/" title="Open link in a new window">Super-slick lighting effects</a></li>\n<li>[Creating an] <a href="http://psdtuts.com/designing-tutorials/creating-a-stunning-old-world-look-in-photoshop/" title="Open link in a new window">Olde Worlde look</a></li>\n</ul>\n<p>What else can I say? <a href="http://psdtuts.com/" title="Open link in a new window">go have a gawk</a>.</p>',frontmatter:{title:"Mastering Photoshop with psdtuts.com",date:"October 08, 2007",tags:["design","external-links","resources"],url:null}}},pathContext:{prev:{frontmatter:{path:"/blog/moving-offices/",tags:["mmt-digital","offices"],title:"Moving Offices!",image:null,date:"2008-10-17T15:00:29.000Z"}},next:{frontmatter:{path:"/blog/movieclip-saturation-class-actionscript-20/",tags:["actionscript","flash","resources"],title:"MovieClip Saturation Class - ActionScript 2",image:null,date:"2007-09-04T22:19:37.000Z"}}}}}});
